import styled from "styled-components";

export const LobbyContainer = styled.div`
    position: relative;
    height: 70vh;
    width: 70vw;
    margin: auto;
    display: flex;
    flex-direction: row;
    align-items:center;
`

export const LobbyTitle = styled.div`
    color: white;
    font-size: 40px;
    position: absolute;
    right: 50%;
`
